import React from "react";
import "../styles/About.css";

export default function About() {
    return (
        <div className="about-container">
            <div className="about-content">
                <p>Добро пожаловать на наш веб-сайт!</p>
                <p>Мы команда профессионалов, стремящихся предоставить вам лучший опыт.</p>
                <p>Мы создаем инновационные решения и доставляем качественные продукты наших клиентам.</p>
            </div>
        </div>
    );
}
